import Pricing from '../../Pricing';

function Login() {
  return (
    <>
        <div className="background">
        <div class="container">
            <div class="row">
                <div class="col-sm">
                One of three columns
                </div>
                <div class="col-sm">
                One of three columns
                </div>
                <div class="col-sm">
                One of three columns
                </div>
            </div>
        </div>

        </div>
      
    </>
  );
}

export default Login;
